import React from 'react'
import { Steps } from 'antd';
const {Step} = Steps;
import _ from 'lodash'
import {NavBarStatus} from '../../model/model'
import styled from 'styled-components'

const StepsStyled = styled(Steps)`
    font-family: 'Mark Pro Bold';
    padding-bottom: 20px; 
    justify-content: center;
    background-color: rgba(229, 229, 229, 0.3);
    padding-left: 80px;
    padding-right: 80px;
    padding-top: 40px;
    padding-bottom: 40px;
    font-size: 20px;
    opacity: 0.5;
`

interface OnboardNavbarProps {
    currentStep: number;
}

const STEPS = [
    "Intro",
    "Build Your Profile",
    "Get Started"
];

export const OnboardNavbar: React.FC<OnboardNavbarProps> = (props) => {

    return (
        <StepsStyled current={props.currentStep}>
            {_.map(STEPS, (step) => {
                return (<Step title={step}/>)
            })}
        </StepsStyled>
    );
}
